VALUES ('gen_random_uuid()', "", 7, 'Сибирский ботанический сад Томского государственного университета является научно-исследовательским учреждением, известным в России ботанико-интродукционным центром, располагающим богатейшими для северных регионов планеты растительными фондами. В ботаническом саду созданы уникальные для северных широт планеты интродукционные фонды растений, которые насчитывают свыше 6000 видов, форм и сортов, в том числе: тропические и субтропические, декоративные древесные и кустарниковые, декоративные травянистые, лекарственные и плодово-ягодные, кормовые и овощные растения, редкие и исчезающие из флоры Томской области. В ботаническом саду выращивается 137 видов редких растений, из них 43 вида занесены в Красную Книгу Российской Федерации.', 3, 56.466310568259345, 84.94649000000003, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/SibirskiBotanGarden/', 'Сибирский ботанический сад', 'http://www.sibbs.tsu.ru/'),
