('gen_random_uuid()', "", 7, 'Городской сад – одно из самых популярных и любимых мест семейного отдыха у Томичей. Территория парка условно делится на две большие зоны – аттракционов и отдыха. Зона отдыха – это живописное озеро с беседкой, фонтан, аллеи парка. Здесь можно прогуляться, посидеть на скамьях, отдохнуть, устроить фотосессии, уединиться для чтения или общения. Зона аттракционов включает в себя разные виды развлечений – семейные, детские, экстремальные.', 0, 56.472466068245055, 84.9547454999999, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/CityGarden/', 'Городской сад', 'https://gorsad-tomsk.ru/'),
